import React from 'react';
import '../App.css';
import './LocationSection.css';

function LoactionSection() {
    return (
      <div className='location-container'>        
        <h1>Location</h1>   
        <GoogleMapReact>
                bootstrapURLKeys={{ key: "bootstrapURLKeys=AIzaSyDUnHLz8Esrh1pWB8W04uJC95LoEmINBcI" }}
                defaultCenter={this.props.center}
                defaultZoom={this.props.zoom}
            >
        <AnyReactComponent
            lat={59.955413}
            lng={30.337844}
            text="My Marker"
        />
            

        </GoogleMapReact>

      </div>

    );
  }
  
  export default LoactionSection;
